import { Link } from 'react-router-dom';
import PageContent from '../components/PageContent';
import Card from '../components/card';
import { useRouteLoaderData } from 'react-router-dom';
function HomePage() {
  const token = useRouteLoaderData('root');

  return (
    <PageContent title="Welcome page !">
      <button><Link to="/auth">let's start</Link></button>
      {localStorage.get('role') === 'admin' && (<Card Title='admin view' />)}
      {token.role === 'admin' && (<Card Title='user view' />)}
      {token.role === 'admin'|'user' && (<Card Title='admin,user view' />)}


    </PageContent>
  );
}

export default HomePage;
